REPLACE INTO `careers` (`id`, `title`, `description`, `requirements`, `location`, `type`, `department`, `salary_min`, `salary_max`, `deadline`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
	(1, 'Network Engineer', '<p>Chalabeel Technology আমাদের আইটি ইনফ্রাস্ট্রাকচার টিমে দক্ষ ও উদ্যমী <strong data-start="349" data-end="369">Network Engineer</strong> খুঁজছে। যদি আপনি নেটওয়ার্কিং, সার্ভার ম্যানেজমেন্ট এবং নিরাপদ আইটি অপারেশনে দক্ষ হন, তবে এই সুযোগটি আপনার জন্য।</p><h3 data-start="489" data-end="510"><strong data-start="493" data-end="510">দায়িত্বসমূহঃ</strong></h3><p>\r\n</p><ul data-start="511" data-end="887">\r\n<li data-start="511" data-end="567">\r\n<p data-start="513" data-end="567">নেটওয়ার্ক ইন্সটলেশন, কনফিগারেশন ও মেইনটেন্যান্স করা</p>\r\n</li>\r\n<li data-start="568" data-end="638">\r\n<p data-start="570" data-end="638">রাউটার, সুইচ, ফায়ারওয়াল ও অন্যান্য নেটওয়ার্ক ডিভাইস কনফিগার করা</p>\r\n</li>\r\n<li data-start="639" data-end="693">\r\n<p data-start="641" data-end="693">নেটওয়ার্ক মনিটরিং ও ট্রাবলশুটিং করে সমস্যা সমাধান</p>\r\n</li>\r\n<li data-start="694" data-end="756">\r\n<p data-start="696" data-end="756">সার্ভার, VPN, এবং নেটওয়ার্ক সিকিউরিটি প্রটোকল ব্যবস্থাপনা</p>\r\n</li>\r\n<li data-start="757" data-end="822">\r\n<p data-start="759" data-end="822">নেটওয়ার্ক পারফরম্যান্স উন্নত করতে প্রয়োজনীয় পরামর্শ প্রদান</p>\r\n</li>\r\n<li data-start="823" data-end="887">\r\n<p data-start="825" data-end="887">আইটি টিমের সঙ্গে সমন্বয় করে ইনফ্রাস্ট্রাকচার সাপোর্ট প্রদান</p></li></ul>', '<li data-start="911" data-end="980"><p data-start="913" data-end="980">কম্পিউটার সায়েন্স/আইটি/নেটওয়ার্কিং-এ স্নাতক ডিগ্রি (অথবা সমমান)</p>\r\n</li><li data-start="981" data-end="1030">\r\n<p data-start="983" data-end="1030">নেটওয়ার্কিং-এ কাজের অভিজ্ঞতা অগ্রাধিকার পাবে</p>\r\n</li><li data-start="1031" data-end="1090">\r\n<p data-start="1033" data-end="1090">CCNA/CCNP বা সমমানের সার্টিফিকেশন থাকলে অতিরিক্ত সুবিধা</p>\r\n</li><li data-start="1091" data-end="1180">\r\n<p data-start="1093" data-end="1180">রাউটার, সুইচ, নেটওয়ার্ক প্রটোকল (TCP/IP, DNS, DHCP, VPN ইত্যাদি) সম্পর্কে গভীর জ্ঞান</p>\r\n</li><li data-start="1181" data-end="1236">\r\n<p data-start="1183" data-end="1236">নেটওয়ার্ক সিকিউরিটি ও মনিটরিং টুলস ব্যবহারে দক্ষতা</p>\r\n</li><p>\r\n\r\n\r\n\r\n\r\n</p><li data-start="1237" data-end="1296">\r\n<p data-start="1239" data-end="1296">সমস্যা সমাধানে দক্ষতা ও দ্রুত সিদ্ধান্ত নেওয়ার সক্ষমতা</p></li>', 'Gurudaspur, Natore', 'Full-time', 'Networking', 20000.00, 30000.00, '2025-11-30', 1, 2, NULL, '2025-11-20 01:59:02', '2025-11-20 01:59:02');
